(1, 'svetil~nik_potolochnyj_lightstar_214912', 'http://sevenlight.ru/files/products/lightstar_214912-1.png', 1, 'светильник потолочный Lightstar 214912', '', '- хорошее решение для интерьеров с небольшими потолками. потолочный светильник прекрасно впишется не только в коридор или спальню, но также и в остальные помещения вашего интерьера. могут быть большими по размеру и быть подходящими и для больших помещений с низкими потолками. Отличным вариантом будет потолочный светильник 214912 Urbano бренда Lightstar, Италия. Данный бренд зарекомендовал себя как надежный изготовитель люстр и светильников, пользующийся хорошим спросом среди российских покупателей. Интересный внешний вид изделия потолочный светильник 214912 сочетается с надежным качеством и практичностью. Эта модель прекрасно впишется в современный интерьер, и не только. Цвет каркаса изделия - бронза, а материал изготовления - металл, плафоны имеют белый цвет. Гармоничная форма и продуманная функциональность данной модели несомненно придаст теплую и радостную атмосферу, независимо от того куда вы собираетесь ее установить. потолочный светильник 214912 подойдет для помещения площадью 5 кв. м, это устройство оснащено лампочками в колличестве - 10 шт. Номинальная мощность составляет 10 ватт. Степень пылевлагозащищенности по международной классификации (Ingress Protection Rating) - IP65. В нашем интернет магазине Sevenlight.ru вы можете купить потолочный светильник Lightstar 214912 по цене с доставкой по Москве и всей России прямо сейчас! В нашем интернет магазине вы имеете уникальную возможность купить данный товар по самой низкой цене в интернете!!! Чтобы получить скидку, используйте код купона REGION при оформлении заказа.', 0, 0, '', '', '', '2017-11-20 19:09:03', 0),
